import React from "react";

const UserChatComponent = () => {
  return (
    <>
      <input type="checkbox" id="check" />
      <i className="bi bi-chat-dots"></i>;<i class="bi bi-x-circle"></i>;
    </>
  );
};

export default UserChatComponent;
